//import modules
import express from 'express'
import cors from 'cors'

//photos
const cats = [
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'https://klike.net/uploads/posts/2020-02/1581760116_1.jpg',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQe4fE4XK3edqFQt3VI0jwGxB5BWnnBkLxQpQ&usqp=CAU',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSkDPSmSqGH5Hz18OjpD0BaofvfQf5rGaF6eA&usqp=CAU',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTQYs8LmToHJzoiKkW7dHzD86leNjsGQ0KwQQ&usqp=CAU',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTttFJKNHxRQ7o3j2LrjxxyYS-VNIh-0hcsnw&usqp=CAU',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSg1tyu4ZFghy_BFS6OFka_FasSh0ue4Lew7w&usqp=CAU',
]

const randomCat = cats[Math.round(Math.random() * cats.length)]

const app = express()

app.use(express.json())
app.use(cors())



app.get('/api/randomcat', (req, res) => {
  try {
    res.send(randomCat)
  } catch (error) {
    return res.status(500).json({
      message: error,
    })
  }
})


app.listen(4444, (error) => {
  error
    ? console.log('ERROR!') //if with errors
    : console.log('Server OK!') //if without errors
})
